<script setup>
import { Link } from '@inertiajs/vue3';
import { computed } from 'vue';

// Define props
const props = defineProps({
  size: {
    type: String,
    default: 'medium',
    validator: (value) => ['small', 'medium', 'large'].includes(value),
  },
});

// Map sizes to width and height values
const sizeMap = {
  small: { width: 170, height: 50 },
  medium: { width: 240, height: 80 },
  large: { width: 520, height: 340 },
};

// Compute width and height based on prop
const svgSize = computed(() => sizeMap[props.size] || sizeMap.medium);
</script>

<template>
  <Link :href="'/'">
    <svg
      xmlns="http://www.w3.org/2000/svg"
      xmlns:xlink="http://www.w3.org/1999/xlink"
      :width="svgSize.width"
      :height="svgSize.height"
      viewBox="0 0 3677 1314"
    >
  <image x="148" y="102" width="3441" height="1138" xlink:href="data:img/png;base64,"/>
</svg>

    </Link>
</template>
